import React from 'react';
import '../App.css';
import {socialLinks} from "./constants";
import styles, {layout} from "../style";

const Socials = () => {
  const socialItems = socialLinks.map( socialItem =>
    <img className={`w-[60px]`} src={socialItem.src} alt={socialItem.name} href={socialItem.link} />
  )

  return (
    <section id="socials">
      <h2 className={`${styles.heading2} flex flex-1`}>Socials</h2>
      <div className="flex justify-center justify-evenly">
        {socialItems}
      </div>
    </section>
  )
}


export default Socials
